interface Children{
    balance:[],
    email:string,
    id:number,
    parentId:number,
    password:string,
    wallet:[],
    wishlist:[],
    name:string
}
interface ListChildrenProps{
    children: Children[]
}
const ListChildren = ({children}:ListChildrenProps) =>{
    return(
        <div>
            {children.map((child)=>(
                <p>{child.name}</p>
            ))}
        </div>
    )
}
export default ListChildren
